import React from 'react';
import home from '../logo.svg';

function NavbarItem() {
    return <div class="navbar-list-item">
        <div class="navbar-list-item-logo">
            <img src={homeLogo} ClassName="home-logo" alt="home" />
        </div>
        <div class="navbar-list-item-text title">
            <span>Home</span>
        </div>
    </div>
}

export default NavbarItem;
